				beforeQTable[endRow][endCol].row = row;
				beforeQTable[endRow][endCol].col = col;
				beforeQTable[endRow][endCol].gx = gx + 1;

				// beforeQTable을 통해 종료 좌표부터 시작 좌표까지 해답 경로에 표시
